                <text class="ar" transform="translate(457.27 460.08) scale(.87 1)">
                    <tspan x="-300" y="0" id="text-v">وذلك بمناسبة </tspan>

                    <tspan x="-120" y="-72" xml:space="preserve" id="name-m"> الطالب (ة)</tspan>
                </text>
                <text class="ao" transform="translate(33.64 529.68) scale(.87 1)"><tspan x="40" y="0">والشكر لله تعالى أولًا، ثم لكل من بذل جهدًا في تحقيق هذا الإنجـاز، ولأساتذة محظرتنا الذين </tspan><tspan x="44" y="30.71">لم يؤلوا جهدًا ولم يدخروا وقتًا في سبيل أن يبقى طلابنا في مقدمة حفظة كتاب الله، وصدارة </tspan><tspan x="479.94" y="61.43">.الفائزين</tspan></text>
                <text class="as" transform="translate(27.3 629.04) scale(.87 1)"><tspan x="35" y="0" xml:space="preserve">وفي الختام، نهدي الطالب (ة)  : اسم المهنئ  خالص التهاني ونتمنى لجميع أبناء وطـــننا الحبيب </tspan><tspan x="426.37" y="30.71">.مزيدًا من التوفيق والنجاح</tspan></text>

    <button onclick="updateSVG()">تحديــــــــث</button>
    <button id="saveButton">PNGحفظ كــــــــ</button>
    <button onclick="saveAsPDF()">PDFحفظ كـــــــــ</button>
</div>


<!-- Include jsPDF Library -->
<script src="../../js/jspdf.umd.min.js"></script>
<script src="../../js/html2canvas.min.js"></script>


<script>
    function updateSVG() {
        const name = document.getElementById("nameIm").value;
        const date = document.getElementById("nameDInput").value;
        const name_v = document.getElementById("nameIv").value;
        const photoInput = document.getElementById("photoInput").files[0];

        if (name) {
            document.getElementById("name-m").textContent = name;
        }
        if (date) {
            document.getElementById("text-date").textContent = "بتاريخ :" + date;
        }
        if (name_v) {
            document.getElementById("text-v").textContent = "وذلك بمناسبة " + name_v;
        }
        if (photoInput) {
            const reader = new FileReader();
            reader.onload = function(e) {
                document.getElementById("photo").setAttribute("href", e.target.result);
            };
            reader.readAsDataURL(photoInput);
        }
    }


    function saveAsPNG() {
      const element = document.getElementById("content");
      const name = document.getElementById("nameIm").value;

      if (!element) {
          console.error("Element not found!");
          return;
      }

      const scale = 2;
      const options = {
          scale: scale,
          logging: true,
          useCORS: true,
          allowTaint: true,
          letterRendering: true,
          backgroundColor: "#FFFFFF",
          windowWidth: element.scrollWidth,
          windowHeight: element.scrollHeight
      };

      html2canvas(element, options).then(canvas => {
          // Create HD PNG with maximum quality
          const link = document.createElement('a');
          link.download = name+'.png';
          link.href = canvas.toDataURL("image/png", 1.0); // 1.0 = maximum quality
          link.click();
      }).catch(error => {
          console.error("Error capturing content:", error);
          alert("Error capturing image: " + error.message);
      });
  }

  window.onload = function() {
      document.getElementById("saveButton").addEventListener("click", saveAsPNG);
  };

  function saveAsPDF() {
    const name = document.getElementById("nameIm").value;
    const element = document.getElementById("content");
    if (!element) {
        console.error("Element not found!");
        return;
    }

    // High quality settings
    const scale = 3;
    const dpi = 300; // Target DPI
    const options = {
        scale: scale,
        logging: true,
        useCORS: true,
        letterRendering: true,
        allowTaint: true,
        backgroundColor: "#FFFFFF"
    };

    html2canvas(element, options).then(canvas => {
        const imgData = canvas.toDataURL('image/png', 1.0);
        const pdf = new jspdf.jsPDF({
            orientation: canvas.width > canvas.height ? 'landscape' : 'portrait',
            unit: 'mm',
            format: [canvas.width * 0.264583, canvas.height * 0.264583],
            compress: false,
            hotfixes: ["px_scaling"]
        });

        const width = (canvas.width * 26.7) / dpi * scale;
        const height = (canvas.height * 26.7) / dpi * scale;

        // Add image to PDF
        pdf.addImage({
            imageData: imgData,
            format: 'PNG',
            x: 0,
            y: 0,
            width: width,
            height: height,
            compression: 'NONE'
        });

        pdf.save(name+'.pdf');
    }).catch(error => {
        console.error("Error generating PDF:", error);
        alert("Error generating PDF: " + error.message);
    });
  }


</script>


<script>
  function toggleMenu() {
      document.querySelector('.nav-links').classList.toggle('show');
  }
</script>

</body>
</html>
